    false,nt"url": null,nt"notes": "This narrative report for Lostwood National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1952.
    The report begins by summarizing the weather conditions, water conditions, and wildfires
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, predators, rodents, and raptors- is also covered. The
    Refuge development and maintenance section discusses physical developments, plantings,
    and collections and receipts. Resource management is outlined; topics include grazing
    and haying. A progress report on field investigations and applied research is also
    provided. The public relations section of the report describes recreational uses,
    Refuge visitors, and Refuge participation. Items of interest and N-R forms are attached.",nt"license_title":
